{'description': 'Comisia Electorală Centrală este o instituţie publică permanentă fondată în vederea realizării politicii electorale, pentru buna organizare şi desfăşurare a alegerilor.  
 
CEC este o instituţie deschisă, transparentă şi profesionistă, în permanenţă pregătită să-şi îndeplinească atribuţiile la cel mai înalt nivel şi într-un cadru electoral accesibil, în care cetăţenii să aibă încredere.  
 
Misiunea Comisiei Electorale Centrale este de a crea condiţii optime pentru ca toţi cetăţenii Republicii Moldova să-şi poată exercita nestingherit dreptul constituţional de a alege şi de a fi ales în cadrul unor alegeri libere şi corecte.', 'created': '2014-02-23T23:59:00.897411', 'title': 'Comisia Electorală Centrală', 'name': '1155-comisia-electorala-centrala', 'revision_timestamp': '2014-02-23T21:59:00.866051', 'is_organization': True, 'state': 'active', 'image_url': 'http://date.gov.md/sites/default/files/organizations/stema_RM_11.jpg', 'revision_id': '27e39ffe-5f8f-4487-97b0-c85bd40fff02', 'type': 'organization', 'id': '1155', 'approval_status': 'approved'}

{'description': 'Casa Naţională de Asigurări Sociale este o instituţie publică autonomă de interes naţional  ce administrează şi gestionează sistemul public de asigurări sociale.
  
Prin intermediul sistemului public de asigurări sociale, statul garantează cetăţenilor dreptul la protecţia socială în cazurile de bătrîneţe, şomaj, boală, invaliditate, de pierdere a întreţinătorului prin plăţi sociale – pensie pentru limită de vîrstă, pensie de invaliditate, pensie de urmaş, indemnizaţie pentru incapacitate temporară de muncă, indemnizaţie de maternitate, indemnizaţie pentru creşterea copilului pînă la vîrsta de trei ani, ajutor de şomaj, ajutor de deces şi alte prestaţii de asigurări sociale. 
', 'created': '2014-02-23T23:59:00.505668', 'title': 'Casa Naţională de Asigurări Sociale', 'name': '1134-casa-nationala-de-asigurari-sociale', 'revision_timestamp': '2014-02-23T21:59:00.475866', 'is_organization': True, 'state': 'active', 'image_url': 'http://date.gov.md/sites/default/files/organizations/LOGO%20CNAS_original.png', 'revision_id': '041d3345-e32a-449a-8737-7d3d5ef167a6', 'type': 'organization', 'id': '1134', 'approval_status': 'approved'}

