{'description': 'Agenţia Naţională pentru Ocuparea Forţei de Muncă (ANOFM) este organul central al serviciului public de specialitate, abilitat cu: promovarea politicilor, strategiilor şi programelor de stat în domeniul dezvoltării pieţei forţei de muncă, protecţia socială a persoanelor aflate în căutarea unui loc de muncă, prevenirea şomajului şi combaterea efectelor sale sociale, implementarea politicii de migraţie a forţei de muncă monitorizarea activităţii agenţiilor private pentru ocuparea forţei de muncă.  
  
MISIUNEA:  
susţinerea implementării strategiilor naţionale pentru ocuparea forţei de muncă, prin asigurarea accesului egal la programe şi servicii de ocupare calitative şi bine direcţionate.  
  
FUNCŢII:  
•	informare pe piaţa muncii;  
•	medierea muncii;  
•	administrarea măsurilor active;  
•	administrarea măsurilor pasive.  
  
Beneficiarii serviciilor ANOFM:  
•	agenţii economici aflaţi în căutare de angajaţi;  
•	persoanele aflate în căutarea unui loc de muncă;  
•	cetăţenii Republicii Moldova care pleacă la muncă peste hotare;  
•	cetăţenii străini angajaţi la muncă în Republica Moldova.  
  
ANOFM este prezentă pe întreg teritoriul ţării prin 35 de agenţii pentru ocuparea forţei de muncă.   
  
Toate serviciile sunt oferite gratuit.  
', 'created': '2014-02-23T23:58:59.377124', 'title': 'Agenţia Naţională pentru Ocuparea Forţei de Munca', 'name': '1171-agentia-nationala-pentru-ocuparea-fortei-de-munca', 'revision_timestamp': '2014-02-23T21:58:59.348062', 'is_organization': True, 'state': 'active', 'image_url': 'http://date.gov.md/sites/default/files/organizations/anofm.jpg', 'revision_id': 'fd97ca2a-5827-4dbb-9af2-32b45636dc68', 'type': 'organization', 'id': '1171', 'approval_status': 'approved'}

